/* eslint no-unused-vars: 0 */
import { ifDefined } from "lit-html/directives/if-defined.js";
import { html, svg, repeat, classMap, styleMap, unsafeHTML, scopeTag } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';

const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<div class="ui5-timeline-root" @focusin=${context._onfocusin} dir="${ifDefined(context.effectiveDir)}"><div class="ui5-timeline-scroll-container"><ul class="ui5-timeline-list" role="listbox" aria-live="polite" aria-label="${ifDefined(context.accessibleName)}">${ repeat(context.items, (item, index) => item._id || index, (item, index) => block1(item, index, context)) }</ul></div></div>`; };
const block1 = (item, index, context) => { return html`<li class="ui5-timeline-list-item" style="list-style-type: none;"><slot name="${ifDefined(item._individualSlot)}"></slot></li>`; };


	return block0(context);
};

export default main;
